import { useState } from "react"

const Tasks = () => {
    const [tasks, setTasks] = useState([{id:3, text:'Food Shopping', day: 'Feb 5th at 2.30pm', reminder: false}])

    return (
        <>
        {tasks.map((task) => (
            <h3 key={task.id}>{tasks.text}</h3>
        ))}
        </>
    )
}

export default Tasks
